const places = [
    {
      title: 'Partners',
      description:
        "You can post all the services offered according to your schedules and prices, with a small fee taken from each completed reservation. Upload images and descriptions of your services. Give the best to your costumers, so you can have amazing reviews. Make this community grow!",
      imageUrl: process.env.PUBLIC_URL + '/assets/image1.jpg',
      time: 1500,
    },
    {
      title: 'Users',
      description:
        'Simplify your life: get what you need when you need it. You can book and hire all kinds of services from different providers. Choose the one that fits your needs, check their reviews to feel more confident.',
      imageUrl: process.env.PUBLIC_URL + '/assets/image2.jpg',
      time: 1500,
    },
  ];

  export default places;
